', '', '', '', '', '', '', '', '', '2064', '1', '<p>Intervensi Mandiri :</p><p>Monitor pola nafas (Frekuensi, kedalaman, usaha nafas), Monitor bunyi nafas tambahan (mis. gurgling, mengi, wheezing, ronchi kering), Monitor sputum (jumlah warna, aroma), Pertahankan kepatenan jalan nafas de Posisikan semi fowler atau fowler, Berikan oksigen,jika perlu, Identifikasi penyebab hipervolemia, Monitor status hemodinamik, Monitor kecepatan infus secara ketat,- Identifikasi gangguan fungsi tubuh yang mengakibatkan kelelahan, Monitor kelelahan fisik dan emosional- Anjurkan tirah baring, Anjurkan melakukan aktivitas secara bertahap</p><p><div>Intervensi Kolaborasi :</div><div>-GDS/6jam : inj apidra 3x6 iu sc, dosis koreksi jika:</div><div>GD <100></div><div>GD 100-200: dosis tetap</div><div>GD 200-300: +3</div><div>GD >300: +5</div><div>- R/Cek GDP/GD2PP besok tgl 25/2/2025</div><div>- R/ Cek AGD ===TH</div><div>- Ukur balance cairan->DC</div><div></div><div><br></div><div></div><div></div><div></div><div></div><div></div><div></div></p>', NULL, '2064', 0, NULL, '2025-02-24 20:14:24')
